('2169','18','7771','Haus Prohens',Null,'Dorfhaus mit Panoramablick in Calvia','30880','Calvia ist die größte Gemeinde im Südwesten Mallorcas und sehr beliebt bei Residenten die den ländlichen mallorquinischen Flair lieben.\r\nDas Haus steht am Ortsrand von Calvia mit tollem Panoramablick auf das Tramuntana Gebirge.\r\nEs wurde 1984 erstellt und 2003 komplett saniert. Die 2 Wohnetagen bieten 2 separat zugängliche Apartments.\r\nApartment 1 hat ca 50m² und liegt im EG mit einem Wohn-Esszimmer mit offener Küche, Badezimmer und Schlafzimmer mit kl. Büroraum.\r\nApartment 2 hat ca 210m², liegt im 1. OG und hat ein Wohn-Esszimmer, Küche, Hauswirtschaftsraum, 4 Schlafzimmer, 2 Badezimmmer davon 1 en suite.\r\nDas Haus ist ausgestattet mit Holz Doppelglasfenster, Kamin und Ölzentralheizung.\r\n2010 wurde der Pool neu erstellt.\r\n','30881','695000','111','2014-03-07 16:01:36','110','2014-03-07 16:02:34',Null,'2096','78','996',1,'1','0',Null,Null,Null,'30882',Null,'0','0','0',Null,'2015-08-31 10:30:51',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'30883',Null,'30884',Null,'30885',Null,'30886','Termin legen  Toni 665 854 352  Margarita 635 032 833','30887','0',0,'0');
